import React from "react";
import { useSelector } from "react-redux";
import AppLayout from "../compoments/AppLayout";

const Home = () => {
    const {isLoggedIn} = useSelector((state) => state)
    return (
    <AppLayout>
        <PostForm/>
        <PostCard/>
    </AppLayout>);
};

export default Home;
